import React from "react";
import PropTypes from "prop-types";

// import logo from './logo.svg';
// import "./App.css";

const foodILike = [
  {
    id: 1,
    name: "Kimchi",
    rating: 4.9,
    image:
      "data:image/jpeg;base64,",
  },
  {
    id: 2,
    name: "Samgubsal",
    rating: 3.1,
    image:
      "data:image/jpeg;base64,",
  },
  {
    id: 3,
    name: "JJajan-Men",
    rating: 2.2,
    image:
      "data:image/jpeg;base64,",
  },
];

function Food({ name, picture, rating }) {
  return (
    <div>
      <h1>I like {name}</h1>
      <h4>{rating}/5.0</h4>
      <img src={picture} alt={name} />
    </div>
  );
  // props.fav=={ fav }
}
Food.propTypes = {
  name: PropTypes.string.isRequired,
  picture: PropTypes.string.isRequired,
  rating: PropTypes.number.isRequired,
};

// 필수는 아니다 넘버이거나 undefined 이거나

function App() {
  return (
    <div>
      {foodILike.map((dish) => (
        <Food
          key={dish.id}
          name={dish.name}
          picture={dish.image}
          rating={dish.rating}
        />
      ))}
    </div>
  );
}

export default App;
